sys_variable_value.value:
(function execute(inputs, outputs) {
    function errorHandler(inputs, outputs) {
        outputs.Status = "Error";
        outputs.ErrorMessage = "Unknown Error. Please check error log for more information";
        outputs = new global.GlobalADErrorHandler().commonErrorHandler(inputs, outputs);
    }
    if (inputs.errorMessage || inputs.errorCode)
        outputs = errorHandler(inputs, outputs);
    else
        outputs.Status = "Success";
})(inputs, outputs);

