sys_variable_value.value:
(function execute(inputs, outputs) {

   var cleanedObject = {};
   var key;
   new global.GlobalADErrorHandler().updateUserErrorHandler(inputs); 
   cleanedObject= new global.GlobalADUtil().cleanseInputObject(inputs,cleanedObject); 

   for (key in cleanedObject) 
         outputs[key] = cleanedObject[key];

})(inputs, outputs);

